import { ThemeOptions } from '@material-ui/core';

const palette: ThemeOptions['palette'] = {
  primary: {
    main: '#1E8DE1',
    contrastText: '#FFFFFF',
  },
  secondary: {
    main: '#F5FAFF',
    contrastText: '#1E8DE1',
  },
  error: {
    main: '#D97067',
    contrastText: '#FFFFFF',
  },
  text: {
    primary: '#212529',
    hint: '#B1B3B4',
    disabled: '#A6A8A9',
  },
};

export default palette;
